  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0104348 includes physical
  and underway data collected aboard the PELICAN during cruise PE11-06 in the Gulf
  of Mexico from 2010-09-01 to 2010-09-07. These data include CURRENT SPEED - EAST/WEST
  COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
  to collect these data include ADCP and GPS. These data were collected by Michael
  Roman of University of Maryland Center for Environmental Science, and by LOUISIANA
  UNIVERSITIES MARINE CONSORTIUM as part of Mapping and Modeling to Quantify Hypoxia
  and Oil Effects in the Northern Gulf of Mexico. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program. The ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
